import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button } from "react-bootstrap";
import React from "react";
import { useState, useEffect } from "react";

function App() {
  return (
    <div className="App">
      <form>
        <input type="text" />
        <Button>Add</Button>
      </form>
    </div>
  );
}

export default App;
